import jsPDF from 'jspdf'

(function (jsPDFAPI) {
var font = "";
var callAddFont = function () {
this.addFileToVFS("PlayfairDisplay-Bold-bold.ttf", font);
this.addFont("PlayfairDisplay-Bold-bold.ttf", "PlayfairDisplay-Bold", "bold");
};
jsPDFAPI.events.push(['addFonts', callAddFont])
 })(jsPDF.API);